pragma solidity ^0.5.1;


import "./TRC21.sol";
 /**
 * SS Engagement Point Smart Contract 
 */

contract Soft2Point is S2TRC21 {

	address private admin;
    //SSRWToken public rewardpoint; //crypto token  

	struct Member {
        string ID;
        string email;
        bool IsRegister;
	}

	struct Company {
        string ID;
        bool IsRegister;
        mapping(address => bool) memberlink;//member link
	}

	///each address is mapped to a specific member or Company
	mapping(address => Member) public Members;
	mapping(address => Company) public Companies;

    enum TransType { Rewarded, Redeemed, Memtrans }
    struct PointsTrans {
        uint points;
        TransType transType;
        address sender;
        address receiver;
    }

    PointsTrans[] public transInfo;

    constructor() public {
		admin = msg.sender;
	}

    
    /**
     * @dev Registers a new Company, only admin or contract owner can call 
     * @param _ID  name of Company
     * @param _coadres Address Company
     * @param _initpoints intial point gave to the this company
     * 
     */

	function regCompany(string memory _ID, address _coadres, uint256 _initpoints) public {
		require(msg.sender == admin);
		require(!Companies[_coadres].IsRegister, "Account already registered as Company");
		Companies[_coadres] = Company(_ID , true); 
        transfer(_coadres, _initpoints);
        

	}

	    /**
     * @dev Registers a new member
     * @param _ID first name of member
     * @param _email email of member
     * @param _memadres address of member

     */
  
	function regMember(string memory _ID, string memory _email, address _memadres) public {
		require(msg.sender == admin);
		require(!Members[_memadres].IsRegister, "Account already registered as Member");
		Members[_memadres] = Member(_ID, _email, true);
	}

	/**
     * @dev member joins the company 
     * @param _coadres address of Company 

     */

	function joinCompany(address _coadres) public{
		require(Members[msg.sender].IsRegister, "Sender not registered as Member"); // only regist member can call this
		require(Companies[_coadres].IsRegister, "This is not a valid Company account");
		Companies[_coadres].memberlink[msg.sender] = true; // link 
	}

	/**
     * @dev Redeem points. Points are transfered from the member to the Company. This function can only be invoked by a member
     * Emits an transfer event.
     * @param _coadres Address of company to be redeemed
     * @param _points Points to be transfered
     */


	function Redeem(address _coadres, uint256 _points) public {
		require(Members[msg.sender].IsRegister, "Sender not registered as Member");
		require(Companies[_coadres].IsRegister, "This is not a valid Company account");
        require(Companies[_coadres].memberlink[msg.sender], "This member has not joined your Company" );
        require(balanceOf(msg.sender) >= _points,"Not enough point to redeem");
        _transfer(msg.sender, _coadres, _points);
        // add transction
        pushTrans (msg.sender, _coadres,TransType.Redeemed, _points);
	}


    /**
     * @dev earn points to a members. This function can only be invoked by a company
     * Emits an transfer event.    
     * @param _memadres Address of member
     * @param _points Points to be transfered
     */

	function Reward(address _memadres, uint256 _points) public{
		require(Companies[msg.sender].IsRegister, "Sender not registered as Company");
		require(Members[_memadres].IsRegister, "This is not a valid member account");
		require(Companies[msg.sender].memberlink[_memadres], "This member has not joined the Company" );
        require(balanceOf(msg.sender) >= _points,"Not enough point to reward");
        _transfer(msg.sender, _memadres, _points);
        // add transction
        pushTrans (msg.sender, _memadres,TransType.Rewarded, _points);
	}

    /**
     * @dev transfer between a members. This function can only be invoked by a member
     * Emits an transfer event.    
     * @param _memadres Address of member
     * @param _points Points to be transfered
     */

	function memberTrans(address _memadres, uint256 _points) public{
		require(Members[_memadres].IsRegister, "Receiver not registered as Member");
        require(Members[msg.sender].IsRegister, "Sender not registered as Member");
        require(balanceOf(msg.sender) >= _points,"Not enough point to transfer");
		_transfer(msg.sender, _memadres, _points);
        // add transction
        pushTrans (msg.sender, _memadres,TransType.Memtrans, _points);      
	}

    /**
     * @dev push transaction info. 
     * @param _sendadres Address of sender
     * @param _receivadres Address of receiver
     * @param _trans trasction type Rewarded,Redeemed or Memtrans
     * @param _points Points to be transfered
     */    
    function pushTrans (address _sendadres, address _receivadres,TransType _trans,uint256 _points) internal {
        transInfo.push(PointsTrans({
        points: _points,
        transType: _trans,
        sender: _sendadres,
        receiver: _receivadres
        }));
    }
}

